INSERT INTO `hotels` VALUES (4731,3055,4460,'foreign',NULL,NULL,'Akgun Istanbul Hotel','{\"address_en\": \"Adnan Menderes Bulvarı (Vatan Cd) Topkapi\"}','{\"lat\": \"41.0229\", \"lng\": \"28.9306\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125344879','+902125349126',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://akgunhotel.com\", \"email\": \"info@akgunhotel.com\", \"description\": \"This luxury hotel is centrally situated in the old town. The Sultan\'s palace is to be found nearby and Istanbul\'s airport is just a 30-minute journey away using public transport.\\n\\nThe hotel building was built in 1992 and renovated in 2003. It consists of 8 floors and 275 rooms of which 265 are doubles and 8 are suites. Situated amidst 500 m² of gardens, facilities include a foyer with a 24-hour reception, a safe, a currency exchange facility and a lift. There is also a café, a shop, a hairdresser\'s salon, a bar, a nightclub, a games room, a conference room, a TV room as well as an air-conditioned à la carte restaurant with a non-smoking area. Guests arriving by car may make use of the garage. Room and laundry services also count amongst the amenities on offer.\\n\\nThe elegant, luxurious rooms are fitted with an en suite bathroom facilities and a hairdryer. In addition, all rooms come with a direct dial telephone, satellite/ cable TV, a safe, a radio, a stereo, a minibar, a double bed, a fridge, a hire safe, a sitting area and central heating.\\n\\nGuests may take advantage of the swimming pool with a poolside snack bar, sun loungers and parasols as well as the gym. On payment of an additional fee there is a sauna, a steam room, a massage service, gymnastics as well as a pool table.\\n\\nGuests are offered breakfast and dinner in the form of a buffet. At midday and in the evenings, guests may also select dishes from the set menu, or take the à la carte option. Special dietary needs as well as individual-specific meals may be provided.\", \"postal_code\": \"34093\", \"Accommodation\": 204}',NULL,NULL),(4732,3055,4461,'foreign',NULL,NULL,'Antik Hotel Istanbul','{\"address_en\": \"Ordu Cad, Darphane(Sekbanbasi) Sok. 10 Beyazit Sultanahmet\"}','{\"lat\": \"41.0089\", \"lng\": \"28.9628\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126385858','+902126385865',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.antikhotel.com\", \"email\": \"info@antikhotel.com\", \"description\": \"Built on a 1,500-year-old Late Roman-Early Byzantine cistern, this hotel combines history, art and culture with comfortable lodging in bright and spacious rooms, as well as exquisite dining and sauna facilities in the centre of Istanbul. The hotel is surrounded by rich history in the centre of old town Beyazit, only a short walk from the grand bazaar and Hagia Sophia, making it easy to explore the city\'s cultural attractions. Guests may sample traditional Turkish cuisine in the hotel restaurant overlooking the minarets of the Blue Mosque, or play backgammon and make use of the substantial library in the café. Antik Cisterna restaurant and exhibition hall displays the restored cistern and is ideal for art exhibitions and banquets of up to 600 guests, while the spacious meeting room is suitable for any business meeting or seminar. Ideal for those seeking a cultural experience, this hotel is a superb choice for business or pleasure.\", \"postal_code\": \"34130\", \"Accommodation\": 204}',NULL,NULL),(4733,3055,4462,'foreign',NULL,NULL,'Berr Hotel','{\"address_en\": \"Akdeniz Cad. No:78 Fatih\"}','{\"lat\": \"41.0178\", \"lng\": \"28.9444\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125342070','+902125342079',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.berrhotel.com\", \"email\": \"info@berrhotel.com\", \"description\": \"This luxurious establishment enjoys a convenient location in the city centre of the vibrant Istanbul, just a short driving distance from the popular Sultanahmet. The beautiful Fatith Mosque, one of the largest examples of Turskish-Islamic architecture in the country is also in the surrounding area. Featuring a choice of different room types with an elegant décor, visitors staying at this unique establishment may find all the necessary amenities for them to feel right at home. The restaurant serves an open buffet breakfast and a wide range of delicious local and international specialities for lunch and dinner. The health centre is the best place to enjoy a relaxing moment in the Turkish bath or sauna.\", \"postal_code\": \"34080\", \"Accommodation\": 204}',NULL,NULL),(4734,3055,4463,'foreign',NULL,NULL,'Black Bird Hotel','{\"address_en\": \"Gençtürk st.No.51/53 Sehzadebasi\"}','{\"lat\": \"41.0121\", \"lng\": \"28.9557\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125117454','+902125114516',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.blackbirdhotel.com\", \"email\": \"info@blackbirdhotel.com\", \"description\": \"This hotel is located around 50 m from the city centre where bars, restaurants and shopping opportunities as well as a bus stop are to be found. Istanbul airport is around 16 kms away. The city\'s sightseeing attractions are within a 10-minute drive. Renovated in 2005, this hotel has a total of 81 rooms. It offers 2 conference rooms as well as Internet access and a WLAN access point. In addition, guests are offered shops, a hairdresser, a bar, a nightclub, a breakfast room and a dining room. Parking facilities are also available. As standard, all bedrooms include an en-suite bathroom, air conditioning and heating. The hotel\'s Turkish bath, massage services and the sauna are all available for an added fee. Guests may serve themselves at the breakfast buffet. At lunchtime and in the evenings guests may select dishes from the set menu or choose from the à la carte option.\", \"postal_code\": \"34340\", \"Accommodation\": 204}',NULL,NULL),(4735,3055,4464,'foreign',NULL,NULL,'Carlton Hotel','{\"address_en\": \"Fevziye Sk. No:22 Sehzadebası/Fatih\"}','{\"lat\": \"41.0123\", \"lng\": \"28.9572\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125114224','+902125193507',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.carltonhotelistanbul.com\", \"email\": \"info@carltonhotelistanbul.com\", \"description\": \"This elegant and modern hotel is excellently situated in the historical centre of Istanbul, the Sultanahmet District. It features a restaurant, pub, lobby bar and a spa area with Turkish bath and sauna. The hotel is an ideal starting point to explore the city, as many of the major sights such as Grand Bazaar, Hagia Sophia, Topkapi Palace, Blue Mosque or Hippodrome are within walking distance.\", \"postal_code\": \"34470\", \"Accommodation\": 204}',NULL,NULL),(4736,3055,4465,'foreign',NULL,NULL,'InterContinental Istanbul','{\"address_en\": \"Asker Ocagi Cad. No :1, Taksim\"}','{\"lat\": \"41.04\", \"lng\": \"28.9882\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123684444','+902123684499',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://istanbul.intercontinental.com.tr/en/general/default.asp\", \"email\": \"fatih_senuslu@interconti.com.tr\", \"description\": \"Refurbished in 2013, the hotel comprises a total of 390 rooms spread over 20 floors and features modern, elegantly furnished accommodation suitable for both business and leisure guests. Located in the heart of the city, just a few hundred metres north of Taksim Square and within walking distance of the Lutfi Kirdar Congress Centre, the hotel is close to many popular attractions, fashionable shops, entertainment venues and the business district. Turkish Airlines shuttle service is close-by and Taksim underground station is less than a 5-minute walk away.\", \"postal_code\": \"34435\", \"Accommodation\": 204}',NULL,NULL),(4737,3055,4466,'foreign',NULL,NULL,'Conrad Istanbul Bosphorus','{\"address_en\": \"Cihannuma Mahallesi Saray Caddesi No: 5 Besiktas\"}','{\"lat\": \"41.047\", \"lng\": \"29.0091\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123102525',NULL,NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://conradhotels1.hilton.com/en/ch/hotels/index.do?ctyhocn=ISTHCCI\", \"email\": \"ISTHC_Conrad@conradhotels.com\", \"description\": \"Located in the centre of Istanbul, the Conrad Istanbul hotel is built in a unique S-shape that allows all rooms to showcase a magnificent view of the scenic Bosphorus waterway. Each luxury room is fitted with a range of modern amenities, including WiFi and satellite TV.This Istanbul hotel boasts three clay tennis courts, two swimming pools, a fully equipped gym, and a separate swimming pool for children. Dine in one of four restaurants and luxury patisseries. Socialize with friends in the amazing Summit Bar and admire the stunning view of the Bosphorus waterway and Istanbul skyline.Awarded the title, \'Turkey\'s Best Business Hotel\' by the World Travel Awards, Conrad Istanbul is the ideal venue for business events and conferences. The Conrad Ballroom is the largest ballroom in Istanbul and can accommodate between 330 and 1500 guests. Each meeting venue is equipped with the latest modern amenities, including WiFi, LCD projectors, and A/V conferencing technology. Keep up to date in the business center offering up to 30 minutes free internet access.Explore Istanbul\'s designer malls and beautiful mosques. Conrad Istanbul is located in the Besiktas area of Istanbul, situated close to tram links leading to the picturesque Old Town. Our friendly Concierge staff will be able to provide maps and help plan a range of exciting activities in historic Istanbul.\", \"postal_code\": \"34353\", \"Accommodation\": 204}',NULL,NULL),(4738,3055,4467,'foreign',NULL,NULL,'Crystal Hotel Istanbul','{\"address_en\": \"Receppasa Caddesi No:7 Talimhane Taksim \"}','{\"lat\": \"41.0398\", \"lng\": \"28.9855\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122378500','+902122379480',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.crystalhotel.net\", \"email\": \"info@crystalhotel.net\", \"description\": \"A short walk from Taksim Square, this city hotel features a marble indoor pool and an in-house restaurant and is located 130 m from the airport shuttle stop. Modernly decorated, the hotel also features a well-equipped spa and has conference facilities and free Wi-Fi. Close to the heart of modern Istanbul, there is a multitude of shops and entertainment venues in the vicinity of the hotel and public transport options allowing easy access to the city\'s many sight-seeing attractions such as those at Sultanahmet, 4.5 km away.\", \"postal_code\": \"34437\", \"Accommodation\": 204}',NULL,NULL),(4739,3055,4468,'foreign',NULL,NULL,'Elan Hotel','{\"address_en\": \"Asmalimescit Mah. Mesrutiyet Cad. No:91 Tepebasi/Beyoglu\"}','{\"lat\": \"41.0303\", \"lng\": \"28.9734\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122525449','+902122526117',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.elanhotel.com.tr\", \"email\": \"info@elanhotel.com.tr\", \"description\": \"Hotel was completely renovated in 2015. There are a total of 51 rooms on the premises. The property consists of 8 single rooms, 17 double rooms, 1 junior suite and 10 triple rooms. This attractive hotel is perfect for a weekend getaway or longer holiday. The front desk offers 24-hour reception. Guests can make use of the currency exchange facilities. Lift access is available to guests for added convenience. Guests may indulge in room service. Guests may take advantage of the Hotel \'s Laundry service. The Hotel provides a babysitting service upon request. There is an airport transfer service for guest convenience. Security is provided 24 hours a day. There is a bellboy service. \", \"postal_code\": \"34430\", \"Accommodation\": 204}',NULL,NULL),(4740,3055,4469,'foreign',NULL,NULL,'Eresin Topkapi Hotel','{\"address_en\": \"Millet Caddesi 186 Topkapi\"}','{\"lat\": \"41.0191\", \"lng\": \"28.9263\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126311212','+902126313702',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.barceloeresintopkapi.com\", \"email\": \"eresintopkapi.res2@barcelo.com\", \"description\": \"This 5 star hotel is located in the city centre of Istanbul and was established in 1995. It is a short drive away from the Sultanahmet and the nearest station is Ulubatli. The Hotel has a restaurant, a bar, a conference room, an indoor swimming pool and a fitness centre/gym. All 250 rooms are equipped with minibar, hairdryer, safe and air conditioning.\", \"postal_code\": \"34270\", \"Accommodation\": 204}',NULL,NULL),(4741,3055,4470,'foreign',NULL,NULL,'Fuar Hotel','{\"address_en\": \"Namik Kemal Cad. Kucuk Langa Araligi Sok. No:1 Aksaray\"}','{\"lat\": \"41.0072\", \"lng\": \"28.95\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126335061','+902125886048',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://www.fuarhotel.com/\", \"email\": \"info@fuarhotel.com\", \"description\": \"Decorated in a classical style, this charming hotel is located in the city centre of Aksaray, close to cultural and historical points of interest such as Topkapi Palace, St Sophia Museum and the Blue Mosque. Shopping and entertainment venues are also to be found in the immediate vicinity. Ataturk International Airport is just 16 kilometres from this hotel. This establishment features a wide choice of comfortable rooms offering satellite TV, minibar and air-conditioning, among others. With an a la carte restaurant situated on the top floor, guests will appreciate the panoramic views over the city. This is the perfect place to discover Turkish hospitality.\", \"postal_code\": \"34300\", \"Accommodation\": 204}',NULL,NULL),(4742,3055,4471,'foreign',NULL,NULL,'Galata Residence','{\"address_en\": \"Bankalar Caddesi,Felek Sokak 2,34420 Galata,Istanbul\"}','{\"lat\": \"41.024177004197\", \"lng\": \"28.974526673555\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122924841','+902122442323',NULL,NULL,2,NULL,NULL,NULL,19,'{\"url\": null, \"email\": \"info@galataresidence.com\", \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4743,3055,4472,'foreign',NULL,NULL,'Golden Age Hotel','{\"address_en\": \"Topcu Cad.No:10 Talimhane Taksim\"}','{\"lat\": \"41.0401\", \"lng\": \"28.9844\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122544906',NULL,NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.goldenagehotel.com/golden-age-istanbul/\", \"email\": \"info@goldenagehotel.com\", \"description\": \"Sitting at just a 5-minute walk from Taksim Square this venue is ideally positioned for exploring this millennia old city. Lutfi Kirdar Convention Centre is 900 metres away and Istiklal Avenue, where guests can find a large choice of bustling cafes, small shops and great outdoor restaurants is within walking distance. Ataturk Airport is at 20 km from the hotel, but the shuttle service can take all of the stress out of the journey. The venue itself is a place where guests can enjoy renowned Turkish hospitality. They are warmly invited to experience the rich Turkish cuisine in the relaxing atmosphere of Le Cog Restaurant. In summer they can enjoy the unique panorama of the Bosphorus while sipping their drinks and trying delicious appetisers at the terrace bar. While in the winter the onsite Café Rose offers the perfect hot tea or strong coffee to help with the chilly breeze.\", \"postal_code\": \"34000\", \"Accommodation\": 204}',NULL,NULL),(4744,3055,4473,'foreign',NULL,NULL,'Grand Ons Hotel','{\"address_en\": \"MESİH PAŞA MH.AZİMKAR SK. NO 22\"}','{\"lat\": \"41.0076\", \"lng\": \"28.9566\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125186370','+902125186374',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.grandons.com\", \"email\": null, \"description\": \"This 3 star hotel is located in the city centre of Istanbul and was established in 1995. The nearest station is METRO. The Hotel has an outdoor swimming pool.\", \"postal_code\": \"34480\", \"Accommodation\": 204}',NULL,NULL),(4745,3055,4474,'foreign',NULL,NULL,'Grand Yavuz Hotel Sultanahmet','{\"address_en\": \"Piyerloti Caddesi No. 51 Sultanahmet\"}','{\"lat\": \"41.006\", \"lng\": \"28.9692\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125171712','+902125178269',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://de.grandyavuzhotel.com\", \"email\": \"info@grandyavuzhotel.com\", \"description\": \"This hotel is located just a short distance away from the old town of Istanbul. The hotel lies close to a myriad of attractions in the city, including the famous Hippodrome Square, the Blue Mosque, Hagia Sophia and the underground cisterns. Shops, restaurants and bars can be found just a short distance away. The Marmara sea and the old quarter can be found just a short distance away. Istanbul Airport is just 15 km from the hotel. This charming hotel appeals to every type of traveller. The guest rooms are superbly designed, blending tradition and contemporary convenience. Guests are invited to avail of the many facilities and services that the hotel has to offer.\\nOur Location Sultanahmet \'Old City \' Istanbul \\nThe Sultanahmet discrict is the heart of historic Old Istanbul ,what 19th centruy travelers used to call \'Stamboul \' . This is where you\'ll find Topkapı palace , The Blue Mosque , The Byzantine Hippodrome , Yerebatan Saray ( Sunken Palace Cistern ), The Istanbul Archeological Museums, Great Palace Mosaic Museum , Ayasofya \' Hagia Sophia \'\\nPrincess Island : You can take tram ( 300 mt Çemberlitaş Tram station  by walk)You get of last station kabataş . \\nIstiklal Street for shoping :You can take tram ( 300 mt Çemberlitaş Tram station by walk )you change the metro at the Kabataş station to go to directly Taksim Istıklal street \\nor You can take bus from Beyazıt\' 400 mt from hotel by walk \' to directly Taksim Istıklal street \\nFatih Shoping Place :10 Min by taxi . Taxi cost is 10 usd \\nFlorya Beach :25 km from hotel . Taxi cost is 20 usd\\n\\n\\n\", \"postal_code\": \"34126\", \"Accommodation\": 204}',NULL,NULL),(4746,3055,4475,'foreign',NULL,NULL,'Hilton Istanbul Bosphorus','{\"address_en\": \"Cumhuriyet Caddesi Harbiye\"}','{\"lat\": \"41.0436\", \"lng\": \"28.9865\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123156000',NULL,NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.hilton.de/istanbul\", \"email\": \"sales.istanbul@hilton.com\", \"description\": \"This modern hotel is located on the European side of Istanbul overlooking the Bosphorus Strait. The Taksim Square is within easy walking distance, the Convention and Exhibition Center and the Istanbul Congress Center can be reached within 5 minutes on foot. The city centre is 5 km away, Atatürk Airport can be reached within 45 minutes by car. The hotel features 499 rooms, 24-hour reception, express check-in and check-out, WIFI, meeting rooms, 24-hour business centre, 3 restaurants, 4 bars, 24-hour fitness centre, spa and wellness, outdoor and indoor pool. Facilities for disabled guests.\", \"postal_code\": \"34367\", \"Accommodation\": 204}',NULL,NULL),(4747,3055,4477,'foreign',NULL,NULL,'Grand Hyatt Istanbul','{\"address_en\": \"Harbiye Mah. Taskisla Caddesi No:1 34367, Sisli\"}','{\"lat\": \"41.0407\", \"lng\": \"28.9889\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123681234','+902123681000',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://istanbul.grand.hyatt.com/en/hotel/home.html\", \"email\": \"istanbul.grand@hyatt.com\", \"description\": \"This hotel is situated at the heart of the mesmerising city of Istanbul. The hotel is located just a short distance away from the beach, offering guests the best of both worlds. Guests will find themselves within easy access of the wide range of attractions that this captivating city has to offer. A number of shopping opportunities, delightful dining options and entertainment venues are to be found nearby. This wonderful hotel greets guests with charm and style, welcoming them into the elegant surroundings of the interior. The guest rooms are sumptuously designed, and feature modern amenities for added comfort and convenience. The hotel offers a wide range of exemplary facilities, meeting the needs of discerning business and leisure travellers alike.\", \"postal_code\": \"34337\", \"Accommodation\": 204}',NULL,NULL),(4748,3055,4478,'foreign',NULL,NULL,'Kariye Hotel','{\"address_en\": \"Kariye Camii Sok. Derviş Ali Mah.No:6 Edirnekapi\"}','{\"lat\": \"41.0308\", \"lng\": \"28.9388\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125348414','+902125216631',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://www.kariyeotel.com\", \"email\": \"info@kariyeotel.com\", \"description\": null, \"postal_code\": \"34087\", \"Accommodation\": 204}',NULL,NULL),(4749,3055,4479,'foreign',NULL,NULL,'Kaya','{\"address_en\": \"Millet Caddesi No: 86,Fındıkzade,Istanbul\"}','{\"lat\": \"41.066260390263\", \"lng\": \"28.891795277595\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126358810','+902125349043',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.kayaoteli.com.tr\", \"email\": \"info@kayaoteli.com.tr\", \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4750,3055,4480,'foreign',NULL,NULL,'Çırağan Palace Kempinski Istanbul','{\"address_en\": \"Çırağan Caddesi 32\"}','{\"lat\": \"41.0443\", \"lng\": \"29.0155\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123264646','+902122596687',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"https://www.kempinski.com/de/istanbul/ciragan-palace/\", \"email\": \"reservations.ciraganpalace@kempinski.com\", \"description\": \"Situated in a 19th century Ottoman palace, this astonishing hotel located just on the edge of the Bosphorus lets guests immerse themselves in the opulence and lavish luxury of days gone. Its excellent features include a garden with infinity pool and stunning views over the sea, the Bosphorus Bridge and to the Asian side of the city, a high class spa and wellness area with hammam as well as various gourmet restaurants and bars.\", \"postal_code\": \"34349\", \"Accommodation\": 204}',NULL,NULL),(4751,3055,4481,'foreign',NULL,NULL,'Kent Hotel','{\"address_en\": \"Ordu caddesi No:29 Beyazıt Fatih \"}','{\"lat\": \"41.0093\", \"lng\": \"28.9608\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126382985','+902126382813',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.istanbulkenthotel.com\", \"email\": \"info@istanbulkenthotel.com\", \"description\": \"Situated in the Beyazıt district of Istanbul, the elegant Kent Hotel enjoys a great location in Istambul. It is just a few steps away from the Grand Bazaar and the Spice Bazaar, and the historic Sultanahmet district with its famous attractions including Topkapi Palace, Hagia Sophia, Blue Mosque, Mosaic Museums, Basilica Cistern or Hippodrome can be reached within a short stroll. \\nGuests are welcomed in a sophisticated atmosphere. The spacious rooms are decorated in a contemporary style with soothing earth tones. Excellent services and amenities include complimentary WIFI throughout the hotel, and business guests will appreciate the business centre and the meeting facilities. The on-site restaurant serves delicious Turkish and international cuisine, and guests can unwind having a drink or a tasty cocktail in the hotel bar. This hotel is a wonderful choice both for business and leisure travellers.\\n\", \"postal_code\": \"34490\", \"Accommodation\": 204}',NULL,NULL),(4752,3055,4482,'foreign',NULL,NULL,'Kilim','{\"address_en\": null}','{\"lat\": \"41.012652912661\", \"lng\": \"28.97539973259\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4754,3055,4484,'foreign',NULL,NULL,'Babil','{\"address_en\": \"Tulbentci Husamettin Mah.,Langa Hisarı Sok. No: 21,Yenikap,Istanbul\"}','{\"lat\": \"41.005095235916\", \"lng\": \"28.954714536667\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126385850','+902125180103',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.babilhotel.com\", \"email\": \"info@babilhotel.com\", \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4755,3055,4485,'foreign',NULL,NULL,'La Maison','{\"address_en\": \"Müvezzi Caddesi No:43,Çırağan,Beşiktaş,34349 Istanbul\"}','{\"lat\": \"41.046408986772\", \"lng\": \"29.012768268585\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122274263','+902122588729',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.lamaison.com.tr/\", \"email\": \"mail@lamaison.com.tr\", \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4756,3055,4486,'foreign',NULL,NULL,'Lamortin','{\"address_en\": null}','{\"lat\": \"41.012450522331\", \"lng\": \"28.97545337677\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4757,3055,4488,'foreign',NULL,NULL,'Mim Hotel Istanbul','{\"address_en\": \"Tesvikiye Mahallesi,Ferah Sokak No. 20,Nisantasi,Istanbul\"}','{\"lat\": \"41.055412133313\", \"lng\": \"28.997763991356\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122312807','+902122307377',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://mimhotelistanbul.com/page/ana-sayfa\", \"email\": \"info@mimhotel.com\", \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4758,3055,4489,'foreign',NULL,NULL,'Mola','{\"address_en\": \"Millet Cad,Findikzade Sk 7,34270 Istanbul\"}','{\"lat\": \"41.012843\", \"lng\": \"28.938513\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126311202','+902126311163',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4759,3055,4490,'foreign',NULL,NULL,'Olcay','{\"address_en\": null}','{\"lat\": \"41.011511\", \"lng\": \"28.962994\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4760,3055,4491,'foreign',NULL,NULL,'Orient Mintur Hotel','{\"address_en\": \"Mermerciler Cad. No:5 Yenikapi\"}','{\"lat\": \"41.0056\", \"lng\": \"28.9542\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125176300','+902125177839',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://orienthotelistanbul.com/\", \"email\": \"orient@orienthotelistanbul.com\", \"description\": \"This charming hotel is located in the old city centre close to the Yenikapi tram stop. Many of the major landmarks of Istanbul, like the Grand Bazaar of Sultanahmet or the Blue Mosque are within walking distance. The hotel features 43 rooms, 24-hours reception, express check-in and check-out, currency exchange, free WIFI in the entire hotel, meeting rooms, restaurant, bar, wellness, car hire and free private parking on site (reservation needed).\", \"postal_code\": \"34026\", \"Accommodation\": 204}',NULL,NULL),(4761,3055,4492,'foreign',NULL,NULL,'Ottoman Hotel Imperial-Special Category','{\"address_en\": \"Caferiye Sok. No.6 Sultanahmet\"}','{\"lat\": \"41.0093\", \"lng\": \"28.9792\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125136150','+902125127628',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://www.ottomanhotelimperial.com\", \"email\": \"info@ottomanhotelimperial.com\", \"description\": \"Ottoman Hotel Imperial was built as an Ottoman school and hospital in the mid of 1800\'s. The building was home to both the teachers and pupils of the historical \'medrese\' for around 70 years. The hospital was built in early 1900\'s and served the merchants of the Ottoman handicraft producers and masters. In the mid of the 20th century the building had been converted to a hotel in order to host young travelers and pupils. The building has gone through several renovations in 2005 and has turned out to be a premium & superior historic hotel.\\nOttoman Hotel Imperial is situated on the truly premium location in town, on an elevated position, surrounded by all the major historic and cultural sights in the heart of the old town, Sultanahmet, viewing the impressive Hagia Sophia (St.Sophia, Aya Sofya) Museum. This is an inspiring location all year around, in the heart of the old city, within walkin\", \"postal_code\": \"34122\", \"Accommodation\": 204}',NULL,NULL),(4762,3055,4493,'foreign',NULL,NULL,'Pianoforte Hotel','{\"address_en\": \"Feyzullah Efendi Cad.17 Kıztası Fatih\"}','{\"lat\": \"41.0159\", \"lng\": \"28.9489\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125342081','+902125311924',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.pianofortehotel.com/\", \"email\": \"info@pianofortehotel.com\", \"description\": null, \"postal_code\": \"34260\", \"Accommodation\": 204}',NULL,NULL),(4763,3055,4494,'foreign',NULL,NULL,'Hotel Residence','{\"address_en\": \"Istiklal Caddesi. Sadri Alışık Sokak No:19\"}','{\"lat\": \"41.0346\", \"lng\": \"28.9808\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122527685','+902122430084',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.hotelresidence.com.tr/\", \"email\": \"info@hotelresidence.com.tr\", \"description\": \"This attractive hotel provides the ideal base for both sightseeing and business. \", \"postal_code\": \"34433\", \"Accommodation\": 204}',NULL,NULL),(4764,3055,4495,'foreign',NULL,NULL,'Richmond Istanbul','{\"address_en\": \"Istiklal Street. No:227 Beyoglu Taksim\"}','{\"lat\": \"41.0298\", \"lng\": \"28.9755\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122525460','+902122529707',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://istanbul.richmondint.com.tr/en/Oteller/RichmondIstanbul/default.aspx\", \"email\": \"info.istanbul@richmondint.com.tr\", \"description\": \"The hotel\'s glorious architecture attracts attention at first glance, combining the memories of the past with contemporary amenities. The most aesthetic amalgamation of old and new, East and West, classic and modern are personified in the hotel. Located in the atmospheric district of Pera on Istiklal Avenue, the hotel is close to business centres, shops and restaurants and has a beautiful view of the Bosphorus from its upper floor restaurant. Taksim Square is a short tram ride from in front of the hotel and the historical attractions at Sultanahmet are just 3 km away.\", \"postal_code\": \"34430\", \"Accommodation\": 204}',NULL,NULL),(4765,3055,4496,'foreign',NULL,NULL,'Salda','{\"address_en\": \"Asagi Guraba Hastane Cad. No 6,Istambul\"}','{\"lat\": \"41.016077262783\", \"lng\": \"28.939490318298\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125349060','+902125336036',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4766,3055,4497,'foreign',NULL,NULL,'Sed','{\"address_en\": \"Omer Avni Mahallesi,Muhtar Leyla Ildır Sokak 6,34427 İstanbul,Ayazpaşa\"}','{\"lat\": \"41.035228\", \"lng\": \"28.991451\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122522710','+902122524274',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.sedhotel.com\", \"email\": \"info@sedhotel.com\", \"description\": \"The hotel is located approximately 180 m from Kabatas ferry port and 750 m from bustling Taksim Square. The historical attractions at Sultanahmet are 4 km away and can be easily reached by public transport. This city hotel has 50 rooms and offers comfortable accommodation with a number of facilities. Guests can benefit from the 24h reception, a cosy ground floor restaurant, as well as a roof terrace restaurant / café-bar affording spectacular views over the Bosphorus. For relaxation, the hotel has a spa with a small indoor pool, sauna and hammam.\", \"postal_code\": null, \"Accommodation\": 204}',NULL,NULL),(4768,3055,4499,'foreign',NULL,NULL,'Sogut Hotel Old City','{\"address_en\": \"Bukalide Sk. No:11 Sehzadebasi\"}','{\"lat\": \"41.0127\", \"lng\": \"28.9553\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125192011','+902125115437',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.soguthotel.com.tr\", \"email\": \"info@soguthotel.com.tr\", \"description\": \"This hotel enjoys a prime setting amidst the bustle and excitement of Istanbul. The hotel is situated just a short distance away from the city centre, where guests will discover a diverse selection of bars, restaurants and shopping venues. A host of attractions can be found close to the hotel. Guests will find themselves within easy access of the captivating attractions that the Sultanahmet District has to offer. The Grand Bazaar is just 1.5 km from the hotel. This charming hotel showcases the splendour of Ottoman style. The guest rooms are superbly designed, immersing visitors in comfort and style. Guests can enjoy the ultimate relaxation in the hammam and sauna. A number of facilities and services are available for guests\' convenience.\", \"postal_code\": \"34134\", \"Accommodation\": 204}',NULL,NULL),(4769,3055,4500,'foreign',NULL,NULL,'Surmeli Istanbul Hotel','{\"address_en\": \"Prof. Dr. Bulent Tarcan Sokak No:3 Gayrettepe\"}','{\"lat\": \"41.065\", \"lng\": \"29.0028\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122721161','+902122720516',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.surmelihotels.com/istanbul/\", \"email\": \"info@surmelihotels.com\", \"description\": \"This contemporary and exclusive hotel is situated near Istanbul\'s commercial and entertainment centre Gayrettepe. Business travellers will appreciate its proximity to the airport, only 25 minutes away, as well as Lutfu Kirdar and Sutluce Convention Centres and Taksim Square, providing easy access to the city\'s thriving business world. Meanwhile, sightseers can visit the nearby Ataturk Museum, and the cultural attractions of the historical peninsula such as Hagia Sophia and the Blue Mosque are within easy reach via metro. Rooms are luxurious and spacious, with modern décor and clean lines. The hotel offers a business centre capable of hosting conferences for up to 500 people as well as several meeting spaces for smaller groups, all equipped with the latest technology and with exquisite catering options available. With its superb conference facilities and central location, this hotel is ideal for hosting events or for exploring the city.\", \"postal_code\": \"34349\", \"Accommodation\": 204}',NULL,NULL),(4770,3055,4501,'foreign',NULL,NULL,'Swissotel The Bosphorus Istanbul','{\"address_en\": \"Visnezade Mah Acısu Sok No:19 Maçka\"}','{\"lat\": \"41.0404\", \"lng\": \"28.9974\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123261100','+902123261122',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.swissotel.com/hotels/istanbul/\", \"email\": \"istanbul@swissotel.com\", \"description\": \"Situated in the Beşiktaş district of Istanbul, this contemporary style hotel is the epitome of modern luxury. Located next to a large park area, it enjoys fantastic views over the Bosphorus and the Asian part of the city. The hotel offers guests seven restaurants, a bar, an excellent fitness centre, hamam and an award-winning spa & wellness centre. Atatürk International Airport can be reached within a 30 minutes\' drive.\", \"postal_code\": \"34357\", \"Accommodation\": 204}',NULL,NULL),(4771,3055,4502,'foreign',NULL,NULL,'Taslik','{\"address_en\": \"Süleyman Seba Caddesi No: 75,34357 Macka,Istanbul\"}','{\"lat\": \"41.042557\", \"lng\": \"28.999788\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122278310','+902122604243',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.taslikhotel.com\", \"email\": \"info@taslikhotel.com\", \"description\": \"The hotel is located a 10-minute walk from the centre of Besiktas and the Dolmabahçe Palace. The historical centre of Sultanahmet with sight-seeing attractions such as the Blue Mosque and Topkapi Palace are approximately 4 km away, and Taksim Square is 1.8 km from the hotel. Other nearby places of interest include the Hagia Sophia, the underground cisterns and the Spice Bazaar, each around 4 km away. Shops, cafés and restaurants are all within a 10-minute walk from the hotel, and the nearest public transport connections are only around 2 minutes\' walk away. Atatürk International Airport is around 22 km away and Sabiha Gökçen International Airport is around 40 km from the hotel.\\n\\nThis city hotel offers a total of 98 rooms and is furnished in a classical/modern style. Guests are welcomed in a spacious lobby/reception area with an open staircase to a mezzanine floor, and a 24-hour reception and check-out service. Additional facilities at this air-conditioned establishment include 28 hotel safes, currency exchange facilities, a cloakroom and lift access, as well as a bar, restaurant and a meeting room/conference facilities. Wireless Internet access, room service and a laundry service are available for a fee. Those arriving by car may leave their vehicle in the hotel car park.\\n\\nAll rooms are en suite with a bath and hairdryer. The rooms are comfortably furnished and have carpeted flooring, and amenities include a double bed, direct dial telephone, satellite TV, Internet access and a minibar (fees apply to the latter). Individually regulated air conditioning and heating feature as standard, and some rooms have a balcony.\\n\\nBreakfast is offered from an open buffet and lunch and dinner may be chosen from the menu.\", \"postal_code\": null, \"Accommodation\": 204}',NULL,NULL),(4772,3055,4503,'foreign',NULL,NULL,'Usta','{\"address_en\": \"Taksim,Istanbul\"}','{\"lat\": \"41.039597655084\", \"lng\": \"28.986074924469\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(4773,3055,4505,'foreign',NULL,NULL,'The Peak Hotel','{\"address_en\": \"Mesrutiyet Cad. Oteller Sok. No:1-3 Tepebasi\"}','{\"lat\": \"41.0309\", \"lng\": \"28.9743\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902122527160','+902122497507',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.thepeakhotel.com.tr/\", \"email\": \"sales@thepeakhotel.com.tr\", \"description\": \"The hotel and its surroundings are the ideal location for holidays and business trips alike. It is next to Istiklal Street, where the heart of the city beats. It provides easy access to any part of the city. Guests can make trips to the historic peninsula of Sultanahmet or the Istanbul Convention and Exhibition Centre, while the Bosphorus and various consulates can be reached within minutes. There is a wide range of dining, entertainment and nightlife options just a 5-minute walk away in Taksim. Attaturk International Airport is approximately 25 km from the hotel. Renovated in 2008, this city hotel features 149 delightfully decorated guest rooms of various kinds, 4 newly designed business centres, tasty Mediterranean and Turkish cuisine, a calm, relaxing atmosphere and reasonable prices, making it an excellent choice for business and leisure travellers alike.\", \"postal_code\": \"34430 \", \"Accommodation\": 204}',NULL,NULL),(4774,3055,4506,'foreign',NULL,NULL,'Hotel Yigitalp Istanbul','{\"address_en\": \"Gencturk Cad. Cukurcesme Sk. No:38 Sehzadebasi\"}','{\"lat\": \"41.0111\", \"lng\": \"28.956\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125129860','+902125122072',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.yigitalp.com\", \"email\": \"sales@yigitalp.com\", \"description\": \"This city hotel enjoys a prime setting at the heart of the enchanting old town of Istanbul. The hotel is surrounded by ample opportunities for exploration and discovery. Guests can explore the Bazaar, the Suleiman Mosque, the Blue Mosque, the famous Hagia Sophia and the Topkapi Palace. The hotel enjoys a traditional, Turkish style, immersing visitors in culture and history. The elegantly-styled guest rooms feature attractive, Turkish influences. Guests can enjoy high-quality dining in the elegant surroundings of the restaurant, where tempting dishes are sure to impress even the most discerning palate.\", \"postal_code\": \"34470\", \"Accommodation\": 204}',NULL,NULL),(4775,3055,4507,'foreign',NULL,NULL,'Hotel Zurich Istanbul','{\"address_en\": \"Vidinli Tevfik Pasa Cad. No:14 Laleli\"}','{\"lat\": \"41.0117\", \"lng\": \"28.9581\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125122350','+902125120153',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.hotelzurichistanbul.com\", \"email\": \"info@hotelzurichistanbul.com\", \"description\": \"This hotel is situated in the historic and cultural area of Istanbul. Restaurants, shops and a bus stop can all be reached in about 100 m, while Istanbul airport is around 15 km away from the hotel. Many of the city\'s sights, such as the Grand Bazaar or the Hagia Sophia Museum, are approximately a 10-minute drive away. Renovated in 2006, the hotel comprises a total of 126 air-conditioned rooms, some of which are disability-friendly. Food and drinks are served at the hotel\'s cafe, piano bar and 2 restaurants. A nightclub is available for evening entertainment. In the hotel grounds guests will find a heated swimming pool with loungers ready for use. Further relaxation is available at the SPA. Sports enthusiasts may also enjoy a workout in the gym.\", \"postal_code\": \"34470\", \"Accommodation\": 204}',NULL,NULL),(5179,1799,4999,'foreign',NULL,NULL,'Jumeirah Beach Hotel','{\"address_en\": \"Jumeirah Beach Road\"}','{\"lat\": \"25.1412\", \"lng\": \"55.191\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+97143480000','+97143016800',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"https://www.jumeirah.com/en/hotels-resorts/dubai/jumeirah-beach-hotel/\", \"email\": \"jbhinfo@jumeirah.com\", \"description\": \"The luxurious Jumeirah Beach Hotel is ideally located beside the beautiful, pristine Jumeirah Beach, yet it is just 20 kms from the centre of Dubai. A short shuttle bus ride away, guests will discover the international congress and convention centres, the World Trade Centre, Dubai Media and Internet City, the Nad Al Sheba racing track and The Montgomerie Golf Club.With its striking wave-like design, this five-star resort is one of Dubai\'s instantly recognisable structures. Boasting elegant beauty, it offers guests a diverse range of exemplary recreational and business amenities and facilities, which cater to the needs of all types of travellers. It provides the perfect setting for a beach or city break with a difference.\", \"postal_code\": \"\", \"Accommodation\": 206}',NULL,NULL),(5180,1799,5000,'foreign',NULL,NULL,'Al Fattan Crystal Towers','{\"address_en\": null}','{\"lat\": \"25.080414851655\", \"lng\": \"55.135515332222\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.alfattan.ae/\", \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(5181,1799,5001,'foreign',NULL,NULL,'Le Royal Meridien Beach Resort & Spa Dubai','{\"address_en\": \"Al Mamsha Street\"}','{\"lat\": \"25.0843\", \"lng\": \"55.1408\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+97143995555','+97143176980',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.leroyalmeridien-dubai.com\", \"email\": null, \"description\": \"TLe Royal Meridien Beach Resort & Spa is the perfect choice for beach and city holidays in Dubai, offering 504 rooms + suites for your every need. The hotel is situated right across from the cosmopolitan JBR Walk - Dubai\'s only beachfront promenade of luxury shops, restaurants and cafes overlooking the clear blue water of the Arabian Gulf.\\n\\nThe hotel offers spectacular facilities including three pools, direct beach access as well as many recreational activities including water sports, fitness activities and children\'s events at Penguin Club. Furthermore, Le Royal Meridien Hotel in Dubai features an array of international award-winning restaurants and bars for you to choose from.\", \"postal_code\": \"\", \"Accommodation\": 206}',NULL,NULL),(5182,1799,5002,'foreign',NULL,NULL,'Habtoor Grand Resort, Autograph Collection','{\"address_en\": \"Al Falea Street, Jumeirah Beach\"}','{\"lat\": \"25.0856\", \"lng\": \"55.1415\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+97143995000','+97143994547',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.marriott.de/hotels/travel/dxbhg-habtoor-grand-resort-autograph-collection\", \"email\": null, \"description\": \"This 5 star hotel is located on the coastline of Dubai and was established in 2005. It is a short drive away from the Dubai Zoo and the nearest station is Dubai Marina Metro Station 1. The Hotel has 5 restaurants, 8 bars, a coffee shop, an outdoor swimming pool and a fitness centre/gym. All 446 rooms are equipped with minibar, hairdryer, safe, trouser press, ironing set and air conditioning.\", \"postal_code\": \"\", \"Accommodation\": 206}',NULL,NULL),(5418,3055,5790,'foreign',NULL,NULL,'Best Western Antea Palace Hotel & Spa','{\"address_en\": \"Kucukayasofya Mah. Yusuf Askin Sok No:28 Sultanahmet\"}','{\"lat\": \"41.0038\", \"lng\": \"28.9709\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902124583636','+902125187197',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://book.bestwestern.com/bestwestern/TR/Istanbul-hotels/BEST-WESTERN-Antea-Palace-Hotel---Spa/Hot\", \"email\": \"info@hotelanteapalace.com\", \"description\": \"Situated in the Sultanahmet District of Istanbul, the historic heart of the Turkish capital, this beautiful hotel allows guests to indulge in the splendour and luxury. It features an excellent spa area with sauna and hammam as well as three restaurants and bars. World-famous attractions such as Blue Mosque, Hagia Sophia, Hippodrome or Topkapi Palace are within a short stroll.\", \"postal_code\": \"34110\", \"Accommodation\": 204}',NULL,NULL),(5835,3055,6387,'foreign',NULL,NULL,'Armada Istanbul Old City Hotel','{\"address_en\": \"Ahirkapi Sok. No:24 Sultanahmet\"}','{\"lat\": \"41.0039\", \"lng\": \"28.9817\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902124554455','+902124554499',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.armadahotel.com.tr/pg_en/\", \"email\": \"info@armadahotel.com.tr\", \"description\": \"This city hotel is located in the centre of Sultanahmet, close to countless shopping venues. There is a train and bus station located about 300 m away. Guests will find the famous Blue Mosque and the Topkapi Palace in the near vicinity of the hotel, along with many other attractions. Istanbul Ataturk Airport is situated 18 kms from the hotel. Renovated in 2009, this hotel comprises a total of 108 rooms spread over 2 floors. Guests are welcomed in the fountain café, which is decorated in Ottoman style. Dining options include a Terrace Restaurant and Bar and a Guest Lounge. Special dietary requirements can be catered for as well as individual specific dishes prepared. There are 5 conference rooms available for business visitors. The rooms all come with an en-suite bathroom with bathtub. Further fittings include an LCD TV, free Wireless Internet connection and air-conditioning.\", \"postal_code\": \"34122\", \"Accommodation\": 204}',NULL,NULL),(5836,3055,6388,'foreign',NULL,NULL,'Best Western Plus The President Hotel','{\"address_en\": \"Tiyatro Cad. No: 25 Beyazit\"}','{\"lat\": \"41.0077\", \"lng\": \"28.9657\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125166980','+902125166998',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.thepresidenthotel.com/\", \"email\": \"info@thepresidenthotel.com\", \"description\": \"This charming hotel enjoys a prime setting in the mesmerising city of Istanbul. The hotel is located in close proximity to the treasure trove of attractions that the city has to offer, including St. Sophia, the Bosphorus Seaway and the Grand Bazaar. Guests will be impressed by the charm and style that greets them at this hotel. Enjoying a sophisticated architectural style, the hotel welcomes visitors into a world of elegance and splendour. The guest rooms are sumptuously appointed, and feature soothing tones and a beautiful blend of contemporary and traditional styles. The hotel affords guests a seemingly endless array of exemplary facilities, catering to the needs of discerning travellers to the highest level of excellence.\", \"postal_code\": \"34126\", \"Accommodation\": 204}',NULL,NULL),(6182,3055,6981,'foreign',NULL,NULL,'Arena Hotel - Special Class','{\"address_en\": \"Sehit Mehmet Pasa Yokusu Ucler Hamam Sok. No:13-15 Sultanahmet\"}','{\"lat\": \"41.0045\", \"lng\": \"28.9727\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902124580364',NULL,NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://arenahotel.com/arena_hotel/\", \"email\": \"info@arenahotel.com\", \"description\": \"With its central location just a stone\'s throw from the Blue Mosque on the historical and cultural peninsula of Istanbul, this attractive hotel provides the ideal base from which to explore the thriving, ancient city on foot. Each of the 27 elegant rooms is uniquely and lavishly decorated with rich fabrics, hardwood floors, and handmade rugs. Attentive concierge staff are happy to help make reservations, travel plans and sightseeing plans 24/7, and the hotel offers a wide range of facilities and services including a meeting room for business, classic Turkish baths, marbling art classes with a professional artist, airport transfers, free breakfast buffet, and free WIFI throughout the hotel. The hotel restaurant provides authentic Turkish buffet-style meals with a variety of mezzes, vegetarian and fish options daily, as well as organic options upon request, and also offers cooking classes.\", \"postal_code\": \"34400\", \"Accommodation\": 204}',NULL,NULL),(6187,3055,6988,'foreign',NULL,NULL,'Galata Konutlari','{\"address_en\": null}','{\"lat\": \"41.0082376\", \"lng\": \"28.9783589\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(6391,1799,7221,'foreign',NULL,NULL,'Al Maha, a Luxury Collection Desert Resort & Spa, Dubai','{\"address_en\": \"Dubai Al Ain Road\"}','{\"lat\": \"24.8236\", \"lng\": \"55.6609\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+97148329900','+97148329211',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.al-maha.com\", \"email\": \"reservation.almaha@luxurycollection.com\", \"description\": \"\\\"\\rThis spectacular resort is located just a 45 minutes\' drive from the mesmerising city of Dubai. Visitors can experience the intrinsic beauty and majesty of the desert and observe the indigenous flora and fauna of the area. Dubai International Airport is just 5 kms from the resort. This resort offers the ideal haven for travelers seeking relaxation and luxury, within easy access of the city\'s sights and sounds.\\rThis oasis of luxury offers guests a tranquil ambience, impeccable service, elegant surroundings and attention to detail. The guest rooms are beautifully-appointed with refreshing colours creating a calming, cool ambience reflective of the natural surroundings. Guests can enjoy the ultimate in pleasure in the Spa or with a refreshing swim in the pool, and the restaurant serves delectable delights for guests to enjoy.\\\"\", \"postal_code\": \"\", \"Accommodation\": 204}',NULL,NULL),(6539,3055,7389,'foreign',NULL,NULL,'All Seasons Hotel','{\"address_en\": \"Molla Gurani Cad. Emin Ali Yasin Sok. No: 5 Fındıkzade\"}','{\"lat\": \"41.0123\", \"lng\": \"28.9406\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126358383','+902126214535',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.hotelallseasons.com\", \"email\": \"reservation@hotelallseasons.com\", \"description\": \"The hotel is located in the historic heart of Istanbul. Sultanahmet Square, Grand Bazaar, Hagia Sophia and many other attractions are just 5 minutes away on foot. It is just a 2-minute walk to Findikzade Tram Stop, which offers easy access to many other sites of the city. The hotel has 66 modern rooms equipped with an LCD TV, air conditioning and an electric kettle. Free Wi-Fi is also available to guests who wish to stay connected. There is free private parking available on site. Leisure facilities include a sauna and massage treatments. The hotel\'s restaurant serves dinner and lunch with à la carte menus. Drinks and refreshments can be enjoyed at the Seasons Bar or Lule Café, which also has a balcony.\", \"postal_code\": \"34270\", \"Accommodation\": 204}',NULL,NULL),(6923,3055,7814,'foreign',NULL,NULL,'Antea Hotel Oldcity -Special Category','{\"address_en\": \"Piyerloti Caddesi No:11 Sultanahmet\"}','{\"lat\": \"41.0073\", \"lng\": \"28.9727\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126381121','+902125177949',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://www.anteahotel.com\", \"email\": \"info@anteahotel.com\", \"description\": \"The hotel is situated in the middle of Istanbul\'s many historical attractions, close to sights and shopping centres such as the Blue Mosque, Hagia Sophia, Topkapi Palace and the Grand Bazaar, all within just few minutes\' walking distance. The hotel\'s location, in one of the oldest and most colourful quarters of Istanbul. With a total of 42 rooms on offer, the air-conditioned establishment comprises a lobby with 24-hour reception, currency exchange facilities, cloakroom, lift access, a café, bar and restaurant. The conference facilities may be of use to business guests. Those arriving by car may make use of the car park and garage. A breakfast buffet is served at the hotel.\", \"postal_code\": \"34400\", \"Accommodation\": 204}',NULL,NULL),(7040,3055,7944,'foreign',NULL,NULL,'Hotel Arcadia Blue Istanbul','{\"address_en\": \"Dr. Imran Oktem Cad. No:1 Sultanahmet\"}','{\"lat\": \"41.0066\", \"lng\": \"28.9734\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125169696','+902125166118',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.hotelarcadiablue.com/\", \"email\": \"info@hotelarcadiaistanbul.com\", \"description\": \"This hotel is located in Sultanahmet, in the heart of Istanbul, a city which has always attracted travellers with its history, its nature, and its archaeological significance. Shops, bars and restaurants are located in the immediate vicinity, as are the famous Hagia Sophia and the Hippodrome. It is approximately 500 m to the Grand Bazaar, while Taksim Square is some 5 kms away. Guests will reach the airport in about 15 kms. Restored in 2006, a total of 48 rooms are on offer within this traditional building, which still reflects the architectural style of the 19th century. The interiors and decoration have been hand-crafted. In the hotel restaurant guests may enjoy outstanding Turkish and international cuisine in a traditional atmosphere with live music all day long, next to a terrace with views of historically important monuments.\", \"postal_code\": \"34400\", \"Accommodation\": 204}',NULL,NULL),(7408,3055,8354,'foreign',NULL,NULL,'Avicenna Hotel','{\"address_en\": \"Mimar Mehmet Aga Cad. Amiral Tafdil Sokak Sultanahmet\"}','{\"lat\": \"41.0041\", \"lng\": \"28.9796\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125170550','+902125166555',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://www.avicennahotel.com\", \"email\": \"info@avicennahotel.com\", \"description\": \"Priding itself on its prime setting, this hotel is centrally located in Istanbul. Surrounded by breath-taking views of a lush park and pristine riverbank, guests are sure to be left with long-lasting memories. The historical centre containing the Blue Mosque, Hagia Sophia Museum and the Topkapi Palace are within walking distance. Ideally located within a 19th century traditional wooden house, this hotel enjoys a modern style, yet has retained elements of its former glory. Guests will be left breathless at the elegant design which each room encompasses. Guests can unwind and divulge into a world of tranquillity after a in the peaceful surrounds of the rooms. Guests will enjoy a breakfast buffet each morning. The Sipsi bar and restaurant offers breath-taking panoramic views of the Marmara sea and islands. Guests will leave this hotel with captivating long-lasting memories.\", \"postal_code\": \"34400\", \"Accommodation\": 204}',NULL,NULL),(7414,3055,8361,'foreign',NULL,NULL,'Avlonya Hotel','{\"address_en\": \"Aksaray Mahallesi Kucuklanga Aralıgı Cad. No: 11 Aksaray Fatih \"}','{\"lat\": \"41.007\", \"lng\": \"28.9495\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125295408','+902125859432',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.avlonya.com/en/\", \"email\": \"info@avlonyahotel.com.tr\", \"description\": null, \"postal_code\": \"34096\", \"Accommodation\": 204}',NULL,NULL),(7420,3055,8368,'foreign',NULL,NULL,'Ayasofya','{\"address_en\": \"Kucuk Ayasofya Caddesi,Demirci Resit Sok. No:28,Sultanahmet,Istanbul\"}','{\"lat\": \"41.005293600587\", \"lng\": \"28.974412679672\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125169446','+902125180700',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.ayasofyahotel.com\", \"email\": \"info@ayasofyahotel.com\", \"description\": \"The hotel is centrally located in the Old City, only a few minutes\' walk from the Blue Mosque, St. Sophia, Topkapi Palace and other tourist attractions. The establishment used to be a wooden edifice built in the 19th century as a private home. In 1980 it was rebuilt in its original Ottoman style and opened as a hotel in July 1990. Ever since then, it has offered traditional Turkish hospitality for guests from all over the world. There are 25 rooms at this historical air-conditioned property. Guests can take advantage of the WLAN Internet access, as well as the other amenities offered. Each room has an en suite bathroom with a shower and is furnished with double beds.\", \"postal_code\": null, \"Accommodation\": 204}',NULL,NULL),(7435,3055,8385,'foreign',NULL,NULL,'Ajwa Hotel Sultanahmet','{\"address_en\": \"Piyerloti No:30, Sultanahmet, Çemberlitaş\"}','{\"lat\": \"41.0063\", \"lng\": \"28.9692\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126382200',NULL,NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.ajwa.com.tr/\", \"email\": \"info@ajwa.com.tr\", \"description\": \"Located in the old city centre, the hotel is within walking distance from the legendary monuments of the area – the Hippodrome, Haghia Sophia, Blue Mosque, etc. Public transport links are within a 10-minute walk while Istanbul Airport is around 18 kms away. The air-conditioned hotel has 105 rooms in total over 9 floors. Facilities include WLAN Internet access, a hairdresser, bars and a restaurant. Conference facilities and a car park are also provided. The rooms are all equipped with central air-conditioning and heating, and are en suite with a bathroom. For leisure, the hotel offers a Jacuzzi, a sauna, a Turkish bath, and fitness centre. Located on the top floor, the roof terrace restaurant provides panoramic views and serves dishes mainly based on fish and kebabs.\", \"postal_code\": \"34490\", \"Accommodation\": 204}',NULL,NULL),(7597,3055,8567,'foreign',NULL,NULL,'Barin Hotel','{\"address_en\": \"Sehzadebasi Fevziye Cd. No:7\"}','{\"lat\": \"41.012\", \"lng\": \"28.9569\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125139100','+902125264440',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.barinhotel.com\", \"email\": null, \"description\": \"This charming city hotel enjoys a prime setting in Istanbul. It offers the perfect setting for travellers who are eager to explore the spectacular sights and sounds this enchanting city has to offer. The hotel is surrounded by stylish boutiques, charming restaurants and lively bars and is within easy walking distance of the bustling city centre. The hotel interior features Turkish designs and embellishment exuding elegance and style. The guest rooms are beautifully decorated featuring soothing, bright colours and come complete with modern amenities for guests\' convenience. The hotel provides a host of excellent services including a meeting room, cafe, relaxing terrace and a lounge bar where guests can enjoy a refreshing drink.\", \"postal_code\": \"34470\", \"Accommodation\": 204}',NULL,NULL),(8027,3055,9067,'foreign',NULL,NULL,'Birbey Hotel','{\"address_en\": \"Kemalpasa Mah.Mektep Sok.1-3 Aksaray\"}','{\"lat\": \"41.0107\", \"lng\": \"28.954\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902125124675','+902125124674',NULL,NULL,0,NULL,NULL,NULL,19,'{\"url\": \"http://www.birbeyhotel.com/\", \"email\": \"info@birbeyhotel.com\", \"description\": \"Refurbished at the beginning of 2013, the hotel\'s new décor is modern and contemporary. Located close to Aksaray, the hotel is well-placed for visiting the historic attractions at Sultanahmet, approximately 10 minutes away by public transport, while the Grand Bazaar is less than 20 minutes\' walk away. Shops, restaurants and an underground station are all close-by in Aksaray.\", \"postal_code\": \"34437\", \"Accommodation\": 204}',NULL,NULL),(8068,3055,9116,'foreign',NULL,NULL,'Blue House','{\"address_en\": \"Dalbasti Sokak 14,Sultanahmet,34400 Istambul\"}','{\"lat\": \"41.005533\", \"lng\": \"28.979122\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126389010','+902126389017',NULL,NULL,3,NULL,NULL,NULL,19,'{\"url\": \"http://www.bluehouse.com.tr\", \"email\": \"info@bluehouse.com.tr\", \"description\": \"Situated in the heart of the historic Sultanahmet district, this popular, family-owned and managed hotel features modernly furnished and equipped rooms and is in an excellent location, just steps away from many of the major sights of this fascinating city. Guests can enjoy three lovely restaurants to dine in, an indoor one for cooler days, a pretty garden restaurant and the wonderful Terrace Marmara rooftop restaurant which is open in the summer months. This is the perfect spot to enjoy the stunning views over the blue Mosque, whilst enjoying some delicious traditional Ottoman cuisine. A tram stop lies 450m from the hotel, providing easy access around the city and there are small shops and restaurants closeby.\", \"postal_code\": null, \"Accommodation\": 204}',NULL,NULL),(8294,1799,9375,'foreign',NULL,NULL,'Burj Al Arab Jumeirah','{\"address_en\": \"Jumeirah Beach Road\"}','{\"lat\": \"25.141\", \"lng\": \"55.1857\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+97143017777',NULL,NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.jumeirah.com/de/hotels-resorts/dubai/burj-al-arab/\", \"email\": \"baainfo@jumeirah.com\", \"description\": \"Burj Al Arab is a business hotel which has repeatedly enjoyed the title of the world\'s most luxurious hotel. This impressive sail-shaped hotel is part of the Jumeirah Beach Resort Complex and will leave guests breathless by living up to its reputation. It boasts a unique setting on an manmade island just 280 metres from the mainland connected by a jetty . It is a mere 15 kms from the South of Dubai City and just 25 kms from Dubai International Airport making it easily accessible.The hotel exudes opulence and elegance at every turn and guests will feel like Arabian royalty once they enter the doors into the decadent lobby. The regal splendour is carried on throughout this magnificent hotel to the guest rooms where lavish fabrics and embellished furnishings echoing Arabian influences.For unparalleled luxury and opulence, look no further. Discover the highly anticipated Burj Al Arab Terrace, set in the stunning azure waters of the Arabian Gulf. Located at Dubai’s most iconic hotel, the terrace is a remarkable, one-of-a-kind restaurant, pool, beach and cabana space, offering hotel guests and Burj Al Arab members the finest Arabian hospitality.\", \"postal_code\": \"\", \"Accommodation\": 206}',NULL,NULL),(8559,1799,9677,'foreign',NULL,NULL,'Capitol Hotel','{\"address_en\": \"Al Mina Road\"}','{\"lat\": \"25.242\", \"lng\": \"55.2752\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+97143460111','+97143460333',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.capitol-hotel.com\", \"email\": \"info@capitol-hotel.com\", \"description\": \"The hotel is a 5-minute drive from the Dubai World Trade Center and Jumeirah Beach Park, while Dubai Mall is around 10 minutes\' drive away.\\n\\nThe air-conditioned hotel features modern architecture with an overtone of elegance. Facilities available to guests in the 168-room hotel include a lobby, breakfast/dining room, conference facilities and room service.\\n\\nIn-room amenities include air conditioning, high-speed Internet access, a safe, minibar, work desk, tea and coffee making facilities and a spacious en suite bathroom with a bathtub and hairdryer.\\n\\nFor the health-conscious, the hotel offers a contemporary gym with a temperature-controlled swimming pool, sauna, steam room, massage treatments and state-of-the-art fitness equipment.\\n\\nGuests can enjoy the morning sun while embracing true luxury. Located on the mezzanine level, The Atrium coffee shop allows beautiful natural light in and serves tasty breakfast delights, as well as the best in international cuisine.\", \"postal_code\": \"\", \"Accommodation\": 204}',NULL,NULL),(8589,3055,9710,'foreign',NULL,NULL,'Darkhill Hotel','{\"address_en\": \"Mimar Kemalettin Mah. Koca Ragippasa Cad.No:9 Laleli\"}','{\"lat\": \"41.0089\", \"lng\": \"28.9595\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902126388900','+902126383343',NULL,NULL,4,NULL,NULL,NULL,19,'{\"url\": \"http://www.darkhillhotel.com/\", \"email\": \"info@darkhillhotel.com\", \"description\": \"This 4 star hotel is located in the city centre of Istanbul and was established in 1994. It is a short drive away from the Grand Bazaar and the nearest station is Laleli tram station. The Hotel has a restaurant, a bar, an indoor swimming pool and a fitness centre/gym. All 106 rooms are equipped with minibar, hairdryer, safe and air conditioning.\", \"postal_code\": \"34130\", \"Accommodation\": 204}',NULL,NULL),(9163,1799,10344,'foreign',NULL,NULL,'Chicago Beach Resort','{\"address_en\": null}','{\"lat\": \"25.2153\", \"lng\": \"55.2744\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,'{\"url\": null, \"email\": null, \"description\": null, \"postal_code\": null, \"Accommodation\": 1}',NULL,NULL),(9950,3055,11275,'foreign',NULL,NULL,'Dedeman Istanbul','{\"address_en\": \"Yıldız Posta Cad. No:50 Gayrettepe\"}','{\"lat\": \"41.0641\", \"lng\": \"29.0101\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'+902123374500','+902122751100',NULL,NULL,5,NULL,NULL,NULL,19,'{\"url\": \"http://www.dedeman.com/otel-istanbul/dedeman-istanbul.aspx\", \"email\": \"istanbul@dedeman.com\", \"description\": \"This 5 star hotel is located within the city of Istanbul and was established in 1982. It is a short drive away from the Shopping Centers and the nearest station is Gayrettepe Metro Stn. The Hotel has a restaurant, a bar, a coffee shop, an indoor swimming pool and a fitness centre/gym. All 325 rooms are equipped with minibar, hairdryer, safe, trouser press and air conditioning.\", \"postal_code\": \"34340\", \"Accommodation\": 204}',NULL,NULL);
