CREATE DEFINER=`root`@`localhost` PROCEDURE `prcGetAirports`(in prmName varchar(50), in prmLanguage char(2))
BEGIN
select
	airports.airportCode,
	concat(airports.airportCode, ' - ', airports.airportName, ' - ', cities.cityName) as dataEn,
	case when
    prmLanguage='fa' then
    concat(countries.language ->> '$.fa',
    case when
    cities.language ->> '$.fa'='null'
    then ''
    else concat( ' - ',cities.language ->> '$.fa') end,
    case when
    airports.language ->> '$.fa'='null'
    then '' else concat( ' - ',airports.language ->> '$.fa') end
    )else ''
    end as datalanguage
    FROM airports
    inner join cities on cities.id = airports.cityId
    inner join countries on countries.id = airports.countryId
    where airportCode like concat(prmName , '%')
    or airportName like concat(prmName , '%')
    or cityName like concat(prmName , '%')
	or (prmLanguage='fa' and countries.language ->> '$.fa' like concat(prmName , '%'))
    or (prmLanguage='fa' and  cities.language ->> '$.fa' like concat(prmName , '%'))
    or (prmLanguage='fa' and airports.language ->> '$.fa' like concat(prmName , '%')) limit 50;
END ;;
