CREATE DEFINER=`root`@`localhost` PROCEDURE `prcRegistration`(
 in prmOrgId int,
 in prmFromOrgId int,
 in prmName varchar(50), 
 in prmFamily varchar(50),
 in prmTelephone json, 
 in prmBuyerData json, 
 in prmEmail varchar(50),
 in prmPassword varchar(150),
 in prmUsername varchar(150)
 )
BEGIN
	DECLARE personId INT DEFAULT 0;
	DECLARE UserId INT DEFAULT 0;
	DECLARE idPerson INTEGER DEFAULT NULL;
    DECLARE CountUser INTEGER DEFAULT NULL;
    DECLARE duplicatation integer default 0;
	SELECT ifnull(id,0) FROM persons
	where mobile =JSON_EXTRACT(prmTelephone ,'$.PhoneNumber') or email = prmEmail  into idPerson;
    -- SELECT count(userId) FROM viwUsers
	-- where mobile =JSON_EXTRACT(prmTelephone ,'$.PhoneNumber') and orgId = prmOrgId  into duplicateCount;
	IF idPerson = 0 THEN
		START TRANSACTION;
			INSERT INTO persons (email,mobile,type,mobileCode,username) VALUES
				(prmEmail,
                 JSON_UNQUOTE(JSON_EXTRACT(prmTelephone ,'$.PhoneNumber')),
				 'user',
				 JSON_UNQUOTE(JSON_EXTRACT(prmTelephone ,'$.CountryAccessCode')),
                 prmUsername);
			SELECT LAST_INSERT_ID() INTO personId;
			INSERT INTO users (orgId, personId, fromOrgId, roleId, sgroupId, levelId,name, family, password, status,buyer) VALUES
			(prmOrgId,
			 personId,
			 prmFromOrgId,
			 1,
			 1,
			 1,
			 prmName,
			 prmFamily,
			 prmPassword,
			 'enabled',
			 prmBuyerData);
			SELECT LAST_INSERT_ID() INTO UserId;
			IF (UserId > 0 AND personId > 0) THEN
			   COMMIT;
			   SELECT viwUsers.userId,
			   viwUsers.name,
			   viwUsers.family,
			   viwUsers.nationalId,
			   viwUsers.username,
			   viwUsers.buyer as data,
			   viwUsers.mobile,
			   viwUsers.mobileCode,
			   viwUsers.email,
			   duplicatation
			   FROM gensec.viwUsers
			   where userId = UserId
				and orgId = prmOrgId;
			ELSE
				ROLLBACK;
			END IF;
	ELSE
    SELECT count(userId) FROM viwUsers
	where viwUsers.personId=idPerson and viwUsers.orgId = prmOrgId into CountUser ;
    IF CountUser = 0 THEN
    START TRANSACTION;
    INSERT INTO users (orgId, personId, fromOrgId, roleId, sgroupId, levelId,name, family, password, status,buyer) VALUES
			(prmOrgId,
			 idPerson,
			 prmFromOrgId,
			 1,
			 1,
			 1,
			 prmName,
			 prmFamily,
			 prmPassword,
			 'enabled',
			 prmBuyerData);
			SELECT LAST_INSERT_ID() INTO UserId;
		IF (UserId > 0) THEN
		   COMMIT;
		   SELECT viwUsers.userId,
		   viwUsers.name,
		   viwUsers.family,
		   viwUsers.nationalId,
		   viwUsers.username,
		   viwUsers.buyer as data,
		   viwUsers.mobile,
		   viwUsers.mobileCode,
		   viwUsers.email,
		   duplicatation
		   FROM gensec.viwUsers
		   where userId = UserId
			and orgId = prmOrgId;
		ELSE
			ROLLBACK;
		END IF;
	ELSE
   
		set duplicatation = 1;
		SELECT viwUsers.userId,
			viwUsers.name,
			viwUsers.family,
			viwUsers.nationalId,
			viwUsers.username,
			viwUsers.buyer as data,
			viwUsers.mobile,
			viwUsers.mobileCode,
			viwUsers.email,
			duplicatation 
		FROM gensec.viwUsers 
		where (mobile = JSON_EXTRACT(prmTelephone ,'$.PhoneNumber')  or email = prmEmail)
		and orgId = prmOrgId;
	END IF;
END IF;
END ;;
DELIMITER ;
